const iucnDic = {
    "A_1": "Extinct",
    "A_2": "Extinct in the wild",
    "A_3": "Creitically endangered",
    "A_4": "Endangered",
    "A_5": "Vulnerable",
    "A_6": "Near threatened",
    "A_7": "Least concern"
}


const NavCat = (props) => {
    const cat = props.cat
    return (
        <>
            <img>{cat.image}</img>
            <p>{cat.name}</p>
            <p>{iucnDic[cat.iucnStatus]}</p>
        </>
    )
}

export default NavCat
